// react
import React from 'react';

// third-party
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

// application
import NavLinks from './NavLinks';
import IndicatorCart from './IndicatorCart';
import UserInfo from './UserInfo';
import DropdownLanguage from './DropdownLanguage';

function NavPanel(props) {
    const { layout } = props;
    let bannerSection;

    if (layout === 'mobile') {
        bannerSection = (
            <div className="ekat-header__banner">
                Banner section
            </div>
        );
    }

    return (
        <div className="nav-panel">
            <div className="nav-panel__nav-links">
                <NavLinks />
            </div>

            <div className="nav-panel__user-info">
                <UserInfo />
            </div>

            <div className="nav-panel__indicators">
                <IndicatorCart />
            </div>

            <div className="nav-panel__language">
                <DropdownLanguage />
            </div>
        </div>
    )
}

NavPanel.propTypes = {
    /** one of ['default', 'mobile'] (default: 'default') */
    layout: PropTypes.oneOf(['default', 'mobile']),
};

NavPanel.defaultProps = {
    layout: 'default',
};

export default NavPanel;
